      conteudo: 'Composicao de Componentes',
      bloco: 11,
      status: 'Aprendendo',
    },
    {
      conteudo: 'Composicao de Estados',
      bloco: 12,
      status: 'Aprenderei'
    },
    {
      conteudo: 'Redux',
      bloco: 16,
      status: 'Aprenderei'
    },
  ];

class Content extends React.Component {
  render() {
    return (
        <div>
          {
              conteudos.map((conteudo) => `O conteúdo é: ${conteudo.conteudo} `)
          }
        </div>

    )
  }
}

export default Content;
